'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class GetAllOffersCommand extends SendSingleCommandWithoutResponse {
    offerIds;
    requestNumber;
    constructor() {
        super();
        this.commandName = "GetAllOffersCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createGetAllOffersRequestMessage(this.tradingSession, this.offerIds, this.requestNumber, stdlib.nowutc());
    }
}
module.exports = GetAllOffersCommand
